        #region 方法一 暴力

        /// <summary>
        /// 暴力法超时
        /// </summary>
        /// <param name="nums"></param>
        /// <returns></returns>
        public int[] ResultArray(int[] nums)
        {
            var list1 = new List<int>();
            var list2 = new List<int>();
            list1.Add(nums[0]);
            list2.Add(nums[1]);
            for (int i = 2; i < nums.Length; i++)
            {
                var one = GreaterCount(list1, nums[i]);
                var two = GreaterCount(list2, nums[i]);
                if (one > two)
                {
                    list1.Add(nums[i]);
                }
                else if (two > one)
                {
                    list2.Add(nums[i]);
                }
                else
                {
                    if (list1.Count > list2.Count)
                    {
                        list2.Add(nums[i]);
                    }
                    else
                    {
                        list1.Add(nums[i]);
                    }
                }
            }
            list1.AddRange(list2);
            var arr = list1.ToArray();
            return arr;
        }

        private int GreaterCount(List<int> nums, int n)
        {
            return nums.Count(p => p > n);
        }

        #endregion 方法一 暴力

        #region 方法二 暴力 + tuple

        /// <summary>
        /// 暴力 + tuple 优化速度
        /// </summary>
        /// <param name="nums"></param>
        /// <returns></returns>
        public int[] ResultArray2(int[] nums)
        {
            var r = new int[nums.Length];
            List<Tuple<int, int>> tuples1 = new List<Tuple<int, int>>();
            List<Tuple<int, int>> tuples2 = new List<Tuple<int, int>>();

            tuples1.Add(new Tuple<int, int>(nums[0], 0));
            tuples2.Add(new Tuple<int, int>(nums[1], 1));

            for (int i = 2; i < nums.Length; i++)
            {
                var n = nums[i];
                var one = GreaterCount2(tuples1, n);
                var two = GreaterCount2(tuples2, n);
                if (one > two)
                {
                    InsertInOrder(tuples1, n, i);
                }
                else if (two > one)
                {
                    InsertInOrder(tuples2, n, i);
                }
                else
                {
                    if (tuples1.Count > tuples2.Count)
                    {
                        InsertInOrder(tuples2, n, i);
                    }
                    else
                    {
                        InsertInOrder(tuples1, n, i);
                    }
                }
            }
            tuples1.Sort((x, y) => x.Item2.CompareTo(y.Item2));
            tuples2.Sort((x, y) => x.Item2.CompareTo(y.Item2));
            var index = 0;
            foreach (var t in tuples1)
            {
                r[index] = t.Item1;
                index++;
            }
            foreach (var t in tuples2)
            {
                r[index] = t.Item1;
                index++;
            }

            return r;
        }

        private void InsertInOrder(List<Tuple<int, int>> list, int first, int second)
        {
            // 创建要插入的Tuple
            var newItem = Tuple.Create(first, second);

            // 查找插入位置，保证列表倒序
            int insertIndex = list.FindIndex(tuple => tuple.Item1 < first);
            // 如果没有找到合适的索引（即新元素比所有现有元素都小），则插入到末尾
            if (insertIndex == -1)
            {
                insertIndex = list.Count;
            }

            // 在计算出的索引处插入新元素
            list.Insert(insertIndex, newItem);
        }

        private int GreaterCount2(List<Tuple<int, int>> list, int n)
        {
            var c = 0;
            int insertIndex = list.FindIndex(tuple => tuple.Item1 < n);
            if (insertIndex != -1)
            {
                c = insertIndex + 1;
            }
            return c;
        }

        #endregion 方法二 暴力 + tuple
